Landing on a Comet - The Rosetta Mission

Science Documentary hosted by Dan Riskin, published by Discovery Channel in 2014 - English narration


Information
------------------------------

Landing on a Comet - The Rosetta Mission 
Dan Riskin is live from Germany as after 10 years of travelling towards its destination and after looping round the sun five times, Rosetta is set to drop in its final location. 
Landing on a Comet - The Rosetta Mission is the pinnacle of a multi-decade space quest - and offers scientists clues to the beginnings of life itself. Designed to withstand the rigours of reckless speeds and turbulence in the solar system, the Rosetta orbiter will rendezvous with Comet 67P/Churyumov-Gerasimenko and remain in close proximity to the icy nucleus as it plunges towards the warmer inner reaches of the Sun's domain. At the same time, a small washing machine-sized lander will be released onto the surface of this mysterious cosmic iceberg.

